window.bookSummaryJSON = "<p>JARED </p> <p>If I had a dollar for every time Banner Morales made my heart skip a beat...</p> <p>The heart everyone assumes is frozen over. </p> <p>Her anger is...arousing. </p> <p>Every glare from those fire-spitting eyes, every time she grits her teeth, gets me...well, you know. </p> <p>If I had a dollar for every time she's put me in my place, I'd be an even richer man. </p> <p>I'm a successful sports agent because I assume \"no\" means you'll think about it. </p> <p>I'm sure what you meant to say is, \"Coming right up.\" </p> <p>They say even rich men don't always get what they want, but those men don't know how to play the game. </p> <p>The trick is to keep them guessing. Take Banner. </p> <p>She assumes she's winning, but this game? </p> <p>She doesn't even know how to play. </p> <p>BANNER </p> <p>If I had a dollar for every time Jared Foster broke my heart, I'd have exactly one dollar. </p> <p>One night. One epic fail. One dollar...and I'm out. </p> <p>I've moved on. I've found success in a field ruled by men. </p> <p>Anything they can do, I have done better. </p> <p>They can keep the field while I call the shots, blocking them when I have to. </p> <p>And Jared has the nerve to think he gets a second chance? </p> <p>Boy, please. Go sit down. Have several seats. </p> <p>I'll just be over here ignoring the man carved from my fantasies with a lust-tipped chisel. </p> <p>Oh, I didn't say the struggle wasn't real. </p> <p>But I've got that one dollar, and Jared won't have me.</p>"; 
